export const save = (data, token) =>
  axios
    .post("/hackathon/api/save", data, {
      headers: {
        Authorization: token,
      },
    })
    .then((res) => {
      console.log("res : ", res);
    })
    .catch((e) => {
      console.error("Error : ", e);
    });
